import React, { Component } from 'react';
import axios from 'axios';

export class Home extends Component {
    constructor(){
        super();
        this.state = {
            houses: []
        }
    }

    componentDidMount(){
        axios.get('http://www.zillow.com/static/xsd/SearchResults.xsd').then( (response)=> {
            console.log(response.data)
        })
    }

  render() {
    return (
      <div>
        Home
      </div>
    )
  }
}

export default Home
